// pages/api/slackInteractiveEndpoint.js

import { createEventAdapter } from "@slack/events-api";

const slackEvents = createEventAdapter("9f3641a8e76c7be5808c02a55e9292b2");

// slackInteractions.on(
//   { type: "button", actionId: "go_to_google_button" },
//   // no need to reply, it's just a button to a url
//   () => {},
// );

export default slackEvents.requestListener();

export const config = {
  api: {
    bodyParser: false,
    externalResolver: true,
  },
};
